let nextGrid = {}
let gridLength = Object.keys(grid).length

const state = {
  "#": 1,
  ".": 0
}

function checkInGrid(pos) {
  return pos >= 0 && pos <= gridLength-1
}

function turnedOn(ledRow, ledPos) {
  if(checkInGrid(ledRow) && checkInGrid(ledPos)) {
    return state[grid[ledRow][ledPos]]
  }
  return state["."]
}

function getNeighboursStates(ledRow, ledPos) {
  let neighbours = 0
  
  neighbours  += turnedOn(ledRow-1, ledPos-1)
  neighbours  += turnedOn(ledRow-1, ledPos)
  neighbours  += turnedOn(ledRow-1, ledPos+1)
  neighbours  += turnedOn(ledRow, ledPos-1)
  neighbours  += turnedOn(ledRow, ledPos+1)
  neighbours  += turnedOn(ledRow+1, ledPos-1)
  neighbours  += turnedOn(ledRow+1, ledPos)
  neighbours  += turnedOn(ledRow+1, ledPos+1)

  return neighbours
}

function getNextState(currentState, neighbours) {
  if(state[currentState]) {
    if(neighbours === 2 || neighbours === 3) {
      return "#"
    }
  } else {
    if(neighbours === 3) {
      return "#"
    }
  }
    return "."
}

function turnCornersOn() {
  grid[0][0] = "#"
  grid[0][gridLength-1] = "#"
  grid[gridLength-1][0] = "#"
  grid[gridLength-1][gridLength-1] = "#"
}

function animateIt() {
  for(row in grid) {
    nextGrid[row] = []
    for(led in grid[row]) {
      let neighboursStates = getNeighboursStates(row*1, led*1)
      let nextState = getNextState(grid[row][led], neighboursStates)
      nextGrid[row][led] = nextState
    }
  }
  Object.assign(grid, nextGrid);
  turnCornersOn()
}

function visualize() {
  let areOn = 0
  document.getElementById("part1").innerHTML = ""
  for(row in grid) {
    let DOMrow = ""
    for(led in grid[row]) {
      DOMrow += grid[row][led]
      areOn += state[grid[row][led]]
    }
    rowEl = document.createElement("p")
    rowEl.innerHTML = DOMrow
    document.getElementById("part1").appendChild(rowEl)
  }
  document.getElementById("part2").innerHTML = `${areOn} lefs are on`
}

function init() {
  turnCornersOn()
  visualize()
  
  let i = 0
  while(i<100) {
    animateIt()
    i++
  }
}

init()